import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 63.2-2202 Virginia Caregivers Grant Fund established.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/63.2-2202.md","filePath":"vacode/63.2-2202.md"}'),i={name:"vacode/63.2-2202.md"},n=t('<h1 id="§-63-2-2202-virginia-caregivers-grant-fund-established" tabindex="-1">§ 63.2-2202 Virginia Caregivers Grant Fund established. <a class="header-anchor" href="#§-63-2-2202-virginia-caregivers-grant-fund-established" aria-label="Permalink to &quot;§ 63.2-2202 Virginia Caregivers Grant Fund established.&quot;">​</a></h1><p>There is hereby established a special fund in the state treasury to be known as the Virginia Caregivers Grant Fund, which shall be administered by the Department. The Fund shall include such moneys as may be appropriated by the General Assembly from time to time and designated for the Fund. The Fund shall be used solely for the payment of grants to caregivers pursuant to this chapter. Unallocated moneys in the Fund in any year shall remain in the Fund and be available for allocation for grants under this chapter in ensuing fiscal years.</p><p>1999, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0737" target="_blank" rel="noreferrer">737</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0763" target="_blank" rel="noreferrer">763</a>, § 63.1-333; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>.</p>',3),s=[n];function l(o,d,h,c,g,_){return a(),r("div",null,s)}const f=e(i,[["render",l]]);export{u as __pageData,f as default};
